@import '../helpers/placeholders';
@import '../helpers/variables';

.my-svg {
  height: 6vw;
  left: 0;
  line-height: 24px;
  overflow-x: hidden;
  overflow-y: hidden;
  position: absolute;
  text-align: center;
  top: 0;
  width: 100%;
}

footer {
  position: relative;
  background-color: #252934;
  h1 {
    font-weight: 600;
    text-transform: uppercase;
  }
  hr {
    background-color: #212529;
    height: 0.2vw;
    width: 7vw;
    margin-bottom: 8vw;
  }
}

#footer__container {
  height: 100vh;
  color: white;
  padding-top: 10vw;
  display: flex;
  flex-direction: column;
  align-items: center;
  dis h1 {
    font-weight: 600;
    text-transform: uppercase;
    text-align: center;
    font-size: 3rem;
  }
  hr {
    background-color: #fff;
    height: 0.2vw;
    width: 7vw;
    margin-bottom: 4vw;
  }
  h4 {
    color: $header-lightBlue;
    font-size: 1.1rem;
    text-align: center;
    font-weight: lighter;
    margin-bottom: 4vw;
  }
}

form {
  display: flex;
  flex-direction: column;
  align-items: center;
  width: 40vw;
  font-size: 1.3rem;
  line-height: 2.5rem;
  font-weight: 100;
  input {
    background-color: #1e232c;
    border: none;
    outline: none;
    margin-top: 0.3vw;
    width: 100%;
    padding: 0 1vw;
    color: white;
    &[type='submit'] {
      color: white;
      background-color: #00000000;
      border: 2px #fff solid;
      align-self: flex-end;
      margin-top: 1vw;
      width: 9vw;
      transition: background-color 500ms;
      &:hover {
        background-color: $header-lightBlue;
      }
    }
  }
  textarea {
    background-color: #1e232c;
    color: white;
    border: none;
    outline: none;
    margin-top: 0.3vw;
    width: 100%;
    height: 13vw;
    padding: 0 1vw;
  }
}

#footerSocial {
  height: 35vh;
  display: flex;
  flex-direction: column;
  align-items: center;
  background-color: #1a242f;
  color: white;
  ul {
    list-style: none;
    li {
      display: inline-block;
      font-size: 1.8rem;
      margin: 0 1vw;
      padding: 0.5vw 1.5vw;
      background-color: #262f38;
      &:hover {
        cursor: pointer;
        background-color: $header-lightBlue;
      }
    }
    margin: 4vw;
  }
  small {
    color: #8f9aa7;
    span {
      color: #e31b6d;
    }
  }
}

#launchBtn {
  i {
    font-size: 2rem;
    background-color: #e31b6d;
    padding: 1vw 1.3vw;
    margin-top: -3vw;
    &:hover {
      cursor: pointer;
    }
  }
}

a {
  text-decoration: none;
  color: white;
  &:hover {
    color: white;
  }
}

